import React, {useState} from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';


function Header() {
   const [userLogIn, setuserLogIn] = useState(false);
  if(document.cookie.lenght > 0){ setuserLogIn(true)} else {setuserLogIn(false)} 

  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="/">Ideas App</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/mascomentados">TopÂ´s</Nav.Link>          
          </Nav>


          {
            userLogIn
            &&
            <Nav>
            <Nav.Link href="/login">Mis ideas</Nav.Link>
            <Nav.Link eventKey={2} href="/registro">
              Logout
            </Nav.Link>
          </Nav>
          }

          {
            !userLogIn
            &&
            <Nav>
            <Nav.Link href="/login">Log In</Nav.Link>
            <Nav.Link eventKey={2} href="/registro">
              Registrarse!
            </Nav.Link>
          </Nav>
          }
         
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
